  ifstream in("maxd.in");
  ofstream out("maxd.out");
  int a, b, d = 0, min = 1 << 30, cnt = 0;
  in >> a >> b;
  for (int i = a; i <= b; ++i) {
    int div = 0;
    for (int j = 1; j * j <= i; ++j) {
      if (!(i % j)) {
        if (j * j == i)
          ++div;
        else
          div += 2;
      }
    }
    if (div > d) {
      d = div;
      min = i;
      cnt = 1;
    } else if (div == d)
      ++cnt;
  }
  out << min << ' ' << d << ' ' << cnt << '\n';
  return 0;
}
